import React from "react";

import Dropdown from "./Dropdown";

const BooleanOperations = {
  Union: "Union",
  Difference: "Box",
  Intersection: "Intersection"
};


export default function BooleanNode({ data, id }) {
    const [operation, setOperation] = React.useState("union");

  return (
    <div className="custom-node">
      <div className="custom-node-header">Primitive</div>
        <Dropdown value={operation} onChange={setOperation} items={["sphere", "box"]} label="Primitives"/> 
        {BooleanOperations.data}
    </div>
  );
}
